  input: '"TEXT","F3XA","C00381384","Your letter dated March 10, 2006 regarding the
    Year-End Report for the 13th Colony Leadership Committee, Inc. (13th Colony),
    indicated 13th Colony did not have sufficient Administrative Expenses reported.  To
    date, 13th Colony has reported all administrative expenses.  13th Colony does
    not maintain a physical address.  All correspondence is mailed to a post office
    box that is different from the Principal Campaign Committee of the Member.  13th
    Colony pays Hancock Askew & Co., LLP in Savannah, Georgia, a standard hourly rate
    for all work performed on behalf of 13th Colony.  The services of Hancock Askew
    include, but are not limited to: accounting services, postage, labor, paying bills,
    and bookkeeping.  These are normally reported on the FEC Report as bookkeeping
    expenses.  13th Colony does pay for a phone line, but all of the other Administrative
    Expenses have been reflected in the payments made to Hancock Askew.  The disbursements
    on the report are true and accurate to the best of our knowledge, and reflect
    the actual operating expenses of 13th Colony.  Frank Slotin, Treasurer"'
